  \"Afforestation at Seney National Wildlife Refuge : 2-yr. results of Smith and Conlon
  Farm eastern white pine plantings and Driggs River Rd. opening red pine and eastern
  white pine (trans)plantings\",\n\t\"tracking_summary\": {\n\t\t\"total\": 5,\n\t\t\"recent\":
