  \"2016-07-27T22:43:05.373147\",\n\t\"name\": \"afforestation-at-seney-national-wildlife-refuge-2-yr-results-of-smith-and-conlon-farm-east\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This document describes the 2-year results
  of treatments for promoting secondary succession within specific farm (hay) fields
  (Conlon and Smith Farms) and the xeric Driggs River Rd. opening at Seney National
  Wildlife Refuge (Seney NWR). Overall guidance is provided by the 2009 Comprehensive
  Conservation Plan (CCP), with more details in the 2013 Habitat Management Plan (HMP).
  Management concepts -imperfect as they might be-were derived from the Refugeu2019s
  Biological Program Review (2006), the Forest Ecology and Management Workshop (2009),
  and other exchanges with colleagues. Resulting management aims at incorporating
  ecologically-based management principles within the constraints of time and financial
  limitations. Active management has also occurred on Sub-Headquarters Field (plowing/disking
  with no further treatment). No active treatments to Chicago Farm have been done
  at the time of this report and none are expected in the near future.\",\n\t\"license_title\":
